import styled from 'styled-components';

export const notFoundContainer = styled.div`
  margin-top: 100px;
  margin-left: 270px;
`;

export const notFoundTitle = styled.div`
  font-size: 50px;
  font-weight: bold;
  margin-bottom: 20px;
`;

export const notFoundDetail = styled.div`
  font-size: 35px;
  margin-bottom: 10px;
`;

export const notFoundBtn = styled.button`
  all: unset;
  color: red;
  font-size: 35px;
`;
